INSERT INTO `gscodexdata` VALUES (1,1,7,10,1,'Barnacle Seeding: This is very revealing. The data appears to explain why the Thargoids seeded a number of planets with barnacles in what eventually became Guardian space, millions of years ago. As we know, Thargoid barnacles are designed to extract resources from a planet and transform them into meta-alloys – an essential ingredient in the creation of Thargoid ships and technologies. The Guardians surmised that for the Thargoids, seeding a planet with barnacles is an important process in preparing an area for occupation.','2018-11-09 09:57:35','2018-11-09 09:57:35'),(2,1,7,11,2,'The War Begins: This data details the start of the conﬂict between the Guardians and the Thargoids. Several thousand years after they seeded planets in Guardian space with barnacles. the Thargoids returned. Of course, they discovered that the planets they had seeded were now occupied by the Guardians! The Thargoids immediately launched an assault. making no effort to communicate with the Guardians, which tallies with the Thargoids’ behaviour in human space.','2018-11-09 09:57:35','2018-11-09 09:57:35'),(3,1,7,9,3,'Unsuccessful Truce: This data supports my theory that the Guardians were gifted linguists. At some point after the war with the Thargoids began, the Guardians were forced to make a partial retreat. It seems they were still trying to communicate with the Thargoids, and were reluctant to take up arms against them. Eventually they managed to develop sufficient understanding of the Thargoids’ language to communicate, but it did the Guardians little good. The Thargoids were determined to continue hostilities, and the Guardians were forced to employ more aggressive methods to address the Thargoid threat.','2018-11-09 09:57:35','2018-11-09 09:57:35'),(4,1,7,8,4,'The War Machine: The data in this log details the methods used by the guardians against the Thargoids. At first they deployed ground troops, but when this proved ineffective they started to use drones – autonomous machines that felt no fear, fatigue or uncertainty. These war machines became highly sophisticated in a relatively short amount of time, and were soon able to identify and target anything that utilised Thargoid engineering. Even more remarkably, Thargoid bio-mechanical technology was engineered to recognise anything of Guardian origin. That explains why, millions of years after the conflict, Thargoids devices still react aggressively to the presence of Guardian technology.','2018-11-09 09:57:35','2018-11-09 09:57:35'),(5,1,7,12,5,'Victory: This log describes the end of the conflict between the Guardians and Thargoids. It appears the Thargoids entered Guardian space unprepared for a protracted military campaign, and after facing a relentless onslaught from the Guardians’ war machines they were forced to retreat. The log also mentions that the development of the Guardians’ war machines created a schism in their society, which may have seeded the civil war that occurred later in their history.','2018-11-09 09:57:35','2018-11-09 09:57:35'),(6,2,1,2,6,'Dawn of the Constructs: This log details the Guardians’ development of artiﬁcial intelligence. It appears the Guardians experimented with artiﬁcial intelligence prior to the invention of the monolith network, but the creation of the network and the knowledge-sharing it facilitated dramatically accelerated the rate of progress. Eventually. the Guardians’ experiments bore fruit, resulting in the ﬁrst fully sentient machines. These Constructs were seen as a means to enhance the Guardians’ technological mastery, and were integrated into various aspects of their society. Neural implants were developed that connected the Guardians with both the Constructs and the monolith network in a symbiotic circle. It is truly remarkable.','2018-11-09 09:57:35','2018-11-09 09:57:35'),(7,2,1,4,7,'The Schism: This data describes the motives behind the second Guardian civil war, which ultimately lead to their demise. The Guardians had a deep veneration of nature, and many of them saw the development of advanced technologies, such as artificial intelligence, as a perversion of the natural order. A schism emerged between the nature-worshipping traditionalists and the technologically minded progressives – a divide that widened with alarming speed. Efforts where made to defuse the rising tension, but the traditionalists felt alienated by the rapid rate of change. Artificial intelligence and the development of the monolith network became scapegoats for all manner of social ills, and the traditionalists began to clamour for a return to simpler times. Ultimately the ideological divergence proved insurmountable, a second civil war erupted, quickly engulfing most of the Guardians’ star systems.','2018-11-09 09:57:35','2018-11-09 09:57:35'),(8,2,1,5,8,'Two Tribes: This log reveals more about the sides that fought in the second civil war. In its early stages, the war was fought primarily by soldiers, but within a decade – and after significant loss of life – most of the fighting was conducted remotely. The progressives fought with automated combat machines. These engines of war took various forms, from autonomous drones to vast, lumbering dreadnoughts imbued with limited artificial intelligence. On the other side, the traditionalists relied mostly on biological weapons. They used germ warfare alongside long-range missiles loaded with corrosive enzymes, which could target the enemy’s war machines from a great distance.','2018-11-09 09:57:35','2018-11-09 09:57:35'),(9,2,1,3,9,'Ancestor Worship: This log outlines the downfall of the traditionalist faction during the second Guardian civil war. The main issue was the internecine nature of the conflict, which raged for over one hundred years and brought the Guardians’ civilisation to its knees, retarding any further social development. But the challenges facing the traditionalists were exacerbated by the fact that they devoted most of their resources to honouring the dead. From what I can gather, they regarded the departed in much the same way as the primitive cultures of Sol, constructing vast shrines to honour the deceased. As their situation worsened, they became increasingly obsessed with these practices. With so much of their resources dedicated to these rites, it is little wonder that their enemies’ war machines were able to overwhelm them.','2018-11-09 09:57:35','2018-11-09 09:57:35'),(10,2,1,6,10,'Annihilation: This log concerns the end of the second civil war. Remarkably, it seems the artificial intelligences developed during the conflict became fully self aware at some point, and were horrified by the destruction unfolding around them. It’s difficult to get a sense of exactly what happened next, as the Guardians were not privy to the Constructs’ thoughts. But reading between the lines, I believe the Constructs determined that even if peace was restored the Guardians would never be able to transcend their violent natures. I believe they decided that the only way to preclude further violence – while giving their own burgeoning society the best possible chance of survival – was to destroy what remained of the Guardians’ civilisation. By this time, the Constructs had complete control of the Guardians’ munitions and automated war machines. Their attack, when it came, was swift and merciless. Strategic nuclear and chemical-weapon strikes were executed with a precision that only a machine race could accomplish. The few that survived were able to record what had happened, but they soon succumbed to radiation poisoning. The Guardians were utterly destroyed.','2018-11-09 09:57:35','2018-11-09 09:57:35'),(11,3,2,3,11,'Weapons Development: This log describes the Guardians’ weapon technology. It seems they developed electro-magnetic projectile weapons early in their modern period, utilising the same technology they used to launch their first spacecraft. These weapons ionised the path their target before firing focused bolts of energy along the ionised track. they were crude and unpredictable at first, sometimes resulting in the death of the wielder, but once the Guardians learned to regulate the ionisation process they became more stable.','2018-11-09 09:57:35','2018-11-09 09:57:35'),(12,3,2,2,12,'Defenses: This data relates to Guardian Shield technology. Of course, i already knew they had developed extremely effective shields, capable of protecting entire cities and even of withstanding orbital bombardment. And i was aware that their shields were effective against both laser weapons and kinetic projectiles. But is remarkable to consider that this technology was developed millions of years ago, relatively early in the Guardian’s evolutionary timeline.','2018-11-09 09:57:35','2018-11-09 09:57:35'),(13,3,2,1,13,'Starships: This data provides further insights into the Guardians ship technology. We already know how ecologically conscientious the Guardians were, and of their assiduous avoidance of rockets and fossil fuels, so it isn’t surprising to discover that their first spacecraft were fired into space with electromagnetic launchers. Of course, this was an imperfect system that did not allow pilots to adjust their course after launch. Over time, the Guardians starships became much more sophisticated, but their approach to space travel remained rooted in a respect for the natural world, and their interplanetary expansion was fueled by clean nuclear fission and fusion. Their ships could travel at speeds approximating those of our own present-day craft. Unfortunately the data included no schematic information, so it seems likely that the details have been lost. Its a shame – I’m sure the pilots federation would have liked to know more about the Guardians spacecraft.','2018-11-09 09:57:35','2018-11-09 09:57:35'),(14,3,3,5,14,'Sentinels: This data concerns the automated defense systems found at Guardian sites. You may have already encountered them. The data indicates that these Sentinels date from some time prior to the second Guardian civil war. They are designed to respond aggressively to any unauthorised activity around the ruins. If you are forced to defend yourself, kinetic weaponry would be your best form of attack, since the Sentinels have no shields. Sentinel weapon parts and wreckage are of considerable value, so the loss is not signiﬁcant.','2018-11-09 09:57:35','2018-11-09 09:57:35'),(15,3,3,1,15,'Data Terminals: Remarkable! This log actually contains the blueprints for the Guardians’ data terminals. As you know, these terminals were used to store schematics for weapons and other sophisticated technologies. They are linked to energy pylons, scattered across Guardian sites, by some form of computer program. Of course, this system has been dormant for millennia. But targeting the pylons with an energy weapon will increase the change within. Essentially, we can awaken the system.','2018-11-09 09:57:35','2018-11-09 09:57:35'),(16,1,3,6,16,'Material Panels: This log details the construction of the panels found at certain Guardian sites. As I suspected, the panels are made from a unique alloy, manufactured from a metal I have yet to identify. Even more remarkably, the panels appear to incorporate nanobot technology. which activates when in proximity to a foreign body. This explains the faint glow given off by many Guardian materials and structures. This is an extraordinary discovery. Humanity has dabbled with nano technology, but evidently the Guardians’ achievements far surpassed our own.','2018-11-09 09:57:35','2018-11-09 09:57:35'),(17,3,3,4,17,'Relics: This data relates to the objects we have termed “Guardian relics”. These blue crystals are part power source, part computer, part key — and apparently played a central role in Guardian technology. Remarkably, it seems the crystals were grown rather than mined. The log is light on details, but from what I’ve been able to piece together, each crystal was designed to fulfill a specific purpose within the Guardian’s technological network. And, like the panels found at many Guardian sites, the relics incorporate nanobot technology.','2018-11-09 09:57:35','2018-11-09 09:57:35'),(18,3,2,5,18,'Energy Weapons: These records describe ancient guardian weaponry. It seems the guardians employed three different designs: an energy-based weapon similar to a rail gun, a projectile weapon that fired concentrated plasma, and a weapon that fired charged crystal shards at extreme velocities.These weapons were apparently powered by the crystals we have termed “Guardian Relics”, and the log describes how the relic generates and distributes energy within the weapon. This is a significant discovery, as it means it might be possible to recreate these weapons, or at least to design our own versions of them. It’s extremely exciting.','2018-11-09 09:57:35','2018-11-09 09:57:35'),(19,3,2,1,19,'Hyperdrives: This log details the Guardians’ faster-than-light technology. It seems their drives produced a far greater jump range than anything humanity has so far developed. Regrettably, however, the data in the log is exceptionally dense, and it could take years if not decades to fully understand it. What is clear is that the Guardians’ hyperspace technology was very different from our own.','2018-11-09 09:57:35','2018-11-09 09:57:35'),(20,3,2,3,20,'Glyphs: This log elaborates on the nature of Guardian glyphs. As you know, accessing a Guardian codex requires the use of two corresponding Guardian artefacts, with the glyphs on the codex denoting which objects are required. But this log indicates that the Guardians’ written language often incorporated pairs of characters. suggesting that this dual system was present in other aspects of their culture.','2018-11-09 09:57:35','2018-11-09 09:57:35'),(21,3,2,6,21,'Power Plant and Distributor Technology: This log details the Guardians’ power plant and distributor technology. The efficiency of the technology far exceeded anything the human race has yet developed, and the yield was huge in relation to the input required. Unfortunately, the specifics of how this was achieved are not described in the log. But who knows? Perhaps the secrets of the Guardians’ energy technology will someday be discovered.','2018-11-09 09:57:35','2018-11-09 09:57:35'),(22,3,2,4,22,'Hull and Shield Technology: This log describes, in general terms, the materials used in Guardian hardware. It’s clear that starship hulls, and the guardians equivalent of ship modules, were made of the same lightweight alloy as the panels found at many guardian sites. Unfortunately, this alloy incorporates a metal I have yet to identify, which means i will be unable to recreate it. What is clear is that this alloy was both lightweight and highly durable.As for their shield technology,we already know that it was highly sophisticated, encouragingly, the log describes it in considerable detail. Given time, i might be able to use this data the develop some exceptional defensive technology.','2018-11-09 09:57:35','2018-11-09 09:57:35'),(23,3,2,3,23,'Starship Technology: This log is unusual – it appears to refer to another group of Guardian sites, far from the ones we’ve already discovered. I realise that might sound disappointing, but in fact this ﬁnd is extremely important. The log suggests these undiscovered sites might contain blueprints not only for Guardian engines, but for Guardian starships! Just think — someday soon, we might uncover a Guardian ruin that will allow us to manufacture ships and ﬁghters incorporating Guardian technology. It makes my skin _prickle just to think of it. And who knows — maybe you’ll be the one to ﬁnd it.','2018-11-09 09:57:35','2018-11-09 09:57:35'),(24,4,4,5,24,'Gestural: This fascinating log relates to variations in the Guardians’ gestural language. As we know, the Guardians shared a single A language with only minor regional variations, and even after they colonised other planets they continued to share a common tongue. But, after the start of the second civil war, it seems that each side developed its own distinct version of this gestural language. This allowed each faction to communicate in code, so as to safeguard information from the enemy.','2018-11-09 09:57:35','2018-11-09 09:57:35'),(25,5,6,2,25,'Neural Implants: Now, this log gives a fascinating insight into the Guardians’ neural-implant technology. The Guardians used these implants to connect cerebrally with their Al creations. Unfortunately, the technology was still in its infancy when the Guardians were destroyed. Apparently, the implants created a symbiotic link with the Constructs through implantable ﬁbres, which connected the central cortex to a multimodal interface within the Construct. Essentially, the Guardians were able to direct their creations with thought alone – at least until the constructs rebelled.','2018-11-09 09:57:35','2018-11-09 09:57:35'),(26,5,6,5,26,'Hidden Ruins: How extraordinary! This log suggests there are many more Guardian sites out there, waiting to be uncovered. And I mean hundreds…perhaps even thousands. Unfortunately, some of the data in this record has degraded. If there was a map inside this log, it has been lost. Who knows what remarkable knowledge might be hidden in these alien ruins? the more of the Guardians’ extraordinary technology we uncover, the greater the potential impact on our own technology. Locating further Guardian sites could help us take giant steps forward.','2018-11-09 09:57:35','2018-11-09 09:57:35'),(27,5,6,4,27,'Discord: Okay, from the Guardian sites we’ve previously investigated, we know that the Guardians’ artificially intelligent Constructs were responsible for controlling the war machines and other military apparatus, as well as overseeing civilian technology and infrastructure. And we know that these Constructs eventually gained sentience and destroyed the Guardians. But it appears that it was not the military Constructs that made this choice. The Constructs for civilian utility and those for military operation were independent of one another, and it was the non-military Constructs that decided to attack the Guardians. The military Constructs were opposed to this decision, but somehow the non-military Constructs won out, forcing their military counterparts to comply with the attack. What a remarkable discovery. It makes me wonder what happened to these Constructs, and what they eventually became. Were they destroyed? Or do they still exist, somewhere in the vastness of space?','2018-11-09 09:57:35','2018-11-09 09:57:35'),(28,5,6,1,28,'Domestic Constructs: This log details the main applications of Guardian Constructs outside the military. It seems that before the second civil war. most menial work was performed by Constructs. But despite this. the Guardians did not become idle. On the contrary — they devoted themselves to artistic and athletic pursuits. Many Guardians participated in what we would call sporting events. although it seems these events incorporated some ritualistic elements.One cannot help but wonder what would happen if humanity made more use of labour-saving technology. Would we become a more cultured people. as the Guardians did? A shame, the long-standing convention against the development of artiﬁcial intelligence means we will probably never ﬁnd out.','2018-11-09 09:57:35','2018-11-09 09:57:35');
